}

struct LocationSearchData:Codable{
    static var uri:String = "https://tripadvisor1.p.rapidapi.com/locations/search?"
    var result_type:String?
    var result_object:AttractionModel?
    var is_top_result:Bool?
    
    static func parseLSD_to_AMID(_ data:[LocationSearchData]) -> [AMID]{
        var count = 0
        var res = data.compactMap { (lsd) -> AMID? in
            var res:AMID? = nil
            if let type = lsd.result_type, type == "things_to_do",let amid = lsd.result_object{
                res = .init(id: count, attraction: amid)
                count += 1
            }
            return res
        }
        return res.count > 0 ? res : attractionExampleTwo
    }
    
    static func extractCityInfo(_ data:[LocationSearchData]) -> AttractionModel{
        var result:AttractionModel = .init( name: "Dubai", map_image_url: "", geo_description: "This is Dubai")
        var top_result = data.filter({$0.is_top_result != nil ? $0.is_top_result! : false})
        if data.count > 0 , let geo = data.first, let res = geo.result_object{
            result = res
        }
        return result
    }
    
    static func extractCategoriesData(_ data:AttractionModel) -> (attr:String,nightLif:String,res:String,shopping:String,activities:String){
        var result:(attr:String,nightLif:String,res:String,shopping:String,activities:String) = (attr:"0",nightLif:"0",res:"0",shopping:"0",activities:"0")
        if let categories = data.category_counts{
            if let attr = categories.attractions?.attractions{
                result.attr = attr
            }
            if let nightLif = categories.attractions?.nightlife{
                result.nightLif = nightLif
            }
            if let res = categories.restaurants?.total{
                result.res = res
            }
            if let shopping = categories.attractions?.shopping{
                result.shopping = shopping
            }
            if let activities = categories.attractions?.activities{
                result.activities = activities
            }
        }
        return result
    }
}

