struct AttractionModel : Codable,Identifiable,Equatable{
    static func == (lhs: AttractionModel, rhs: AttractionModel) -> Bool {
        return lhs.id == rhs.id
    }
    
    var coordinates:CLLocationCoordinate2D{
        get{
            var result:CLLocationCoordinate2D = .init(latitude: 0.0, longitude: 0.0)
            if let lat = self.latitude, let lon = self.longitude{
                result.latitude = .init(Float(lat) ?? 0.0)
                result.longitude = .init(Float(lon) ?? 0.0)
            }
            return result
        }
    }
    
    var id:String{
        get{
            return self.location_id ?? "1"
        }
    }
    var location_id:String?
    var name:String?
    var latitude:String?
    var longitude:String?
    var num_review:String?
    var timezone:String?
    var location_string:String?
    var photo:Photos?
